import React from "react";

export default function Card({ children, className = "", onClick }) {
  const baseClass = "rounded shadow-md bg-white";

  return (
    <div
      className={`${baseClass} ${className}`}
      onClick={onClick}
      style={{ cursor: onClick ? "pointer" : "default" }}
    >
      {children}
    </div>
  );
}
